import { useEffect, useState } from "react";
import axios from "axios";
function GetTransactions() {
    const [data, setData] = useState([]);
    useEffect(() => {

        const fetchdata = async () => {
            const { data } = await axios.get("http://localhost:4000/GetTransactions", { params: { ROLENAME: localStorage.getItem("ROLENAME") } });
            
            if (data.found === false) {
                window.alert("Login to get details");
            }
            else {
                setData(data.data);
            }
        }
        fetchdata();
    }, []);
    console.log(data);
    return (
        <>
            <div>

            <table className="table table-striped" >
                <thead>
                    <tr>
                        <th scope="col">TransactionHash</th>
                        <th scope="col">From</th>
                        <th scope="col">To</th>
                        <th scope="col">Time</th>
                        <th scope="col">GasUsed</th>
                    </tr>
                </thead>
                <tbody>
                {
                   
                   data.TransactionHash.map((ele,i)=>{
                    return (
                        <tr>
                            <td>{data.TransactionHash[i]}</td>
                            <td>{data.from[i]}</td>
                            <td>{data.to[i]}</td>
                            <td>{data.time[i]}</td>
                            <td>{data.gasUsed[i]}</td>
                        </tr>
                        
                    )
                   })
                     
                   
                }
                   
                </tbody>

            </table>
            </div>
        </>
    );




























}

export default GetTransactions;
